INSERT INTO `articles` (`ID_JEU`, `Nom`, `Prix`, `Description`, `Date`, `ID_Editeur`) VALUES
(2, 'Hogwarts Legacy : L\'Héritage de Poudlard - Europe', 50.000, 'Hogwarts Legacy pour PC est un jeu de rôle d\'action et d\'aventure solo basé sur l\'univers de Harry Potter, dans lequel le joueur incarne un nouveau venu dans le château enchanté tant apprécié des fans des livres et de la franchise cinématographique.', '2023-02-10', 3),
(3, 'Détroit become Human', 39.000, 'Detroit: Become Human met le destin de l\'humanité et des androïdes entre vos mains, dans un futur proche où les machines sont devenues plus intelligentes que les hommes. Tous vos choix ont une incidence sur la suite du jeu, dans l\'une des narrations les plus élaborées jamais écrites.', '2020-06-18', 4),
(4, 'Wo Long: Fallen Dynasty', 44.000, 'Wo Long: Fallen Dynasty est un jeu vidéo développé par Team Ninja et publié par Koei Tecmo, sorti le 3 mars 2023 sur Windows, Xbox One, Xbox Series, PlayStation 4 et PlayStation 5.', '2023-03-03', 5),
(5, 'Elden Ring', 59.000, 'UNE NOUVELLE AVENTURE GRANDIOSE VOUS ATTEND Levez-vous, Sans-éclat, et puisse la grâce guider vos pas. Brandissez la puissance du Cercle d\'Elden. Devenez Seigneur de l\'Entre-terre.', '2022-02-25', 6),
(6, 'Resident Evil 4', 59.000, 'La survie n\'est que le début. Avec un gameplay modernisé, une histoire revisitée et des graphismes ultra détaillés, Resident Evil 4 signe la renaissance d\'un monstre de l\'industrie. Replongez dans le cauchemar qui a révolutionné les jeux d\'horreur et de survie.', '2023-03-24', 8),
(22, 'Minecraft', 23.000, 'Minecraft plonge le joueur dans un monde créé de manière procédurale, composé de voxels (des cubes) représentant différents matériaux comme de la terre, du sable, de la pierre, de l\'eau, de la lave ou des minerais (du fer, de l\'or, du charbon, etc. ) formant diverses structures (arbres, cavernes, montagnes, temples).', '2011-11-18', 37),
(23, 'Company of Heroes 3 - Europe', 36.000, 'Company of Heroes 3 est un jeu vidéo de stratégie en temps réel développé par Relic Entertainment et édité par Sega pour Microsoft Windows. Le jeu se déroule dans les théâtres de guerres italiens et nord-africains de la Seconde Guerre mondiale et propose de nouveaux modes et mécanismes.', '2023-02-23', 39),
(24, 'FIFA 23', 46.990, 'EA SPORTS FIFA 23 vous permet de vivre The World’s Game sur le terrain avec la technologie HyperMotion2 qui apporte encore plus de réalisme au gameplay. Disputez les Coupes du Monde de la FIFA féminine et masculine grâce à des mises à jour d\'après-lancement, défendez les couleurs de clubs féminins et bénéficiez des fonctions universelles*, entre autres. Profitez d’un réalisme sans précédent avec plus de 19 000 joueurs, plus de 700 équipes, plus de 100 stades et plus de 30 compétitions dans FIFA 23.', '2022-09-29', 40),
(45, 'Star Wars Jedi: Survivor', 49.990, 'L\'histoire de Cal Kestis continue dans Star Wars Jedi: Survivor, un jeu d\'action-aventure galactique à la troisième personne développé par Respawn Entertainment en collaboration avec Lucasfilm Games. Se déroulant cinq ans après les événements de Star Wars Jedi: Fallen Order, ce jeu narratif en solo suit le combat de Cal, dont l\'issue semble de plus en plus défavorable, alors que la galaxie s\'enfonce dans l\'obscurité. Poussé aux confins de la galaxie par l\'Empire, Cal devra faire face à toujours plus de menaces, parmi lesquelles l\'attendent des adversaires au visage familier. En tant qu\'un des derniers représentants encore en vie des Chevaliers Jedi, Cal devra faire un choix pendant cette période sombre de l\'histoire de la galaxie. Mais jusqu\'où sera-t-il prêt à aller pour assurer sa survie et celle de son équipage, et défendre l\'héritage de l\'Ordre Jedi ?', '2023-04-28', 40),
(46, 'Ravenswatch', 20.000, 'Ravenswatch est un action rogue-like en vue du dessus, mêlant d\'intenses combats en temps réel à une grande profondeur de jeu et une forte rejouabilité. Fort du succès de Curse of the Dead Gods©, Passtech revient avec une nouvelle formule et la promesse d\'une expérience jouable en solo et en coopération jusqu\'à 4 joueurs.', '2023-04-06', 42),
(47, 'The Last of Us Part 1', 60.000, 'Retrouvez l\'histoire poignante et les personnages inoubliables de The Last of Us™, lauréat de plus de 200 récompenses du Jeu de l\'année. Dans un monde dévasté où rôdent infectés et survivants endurcis, Joel, un protagoniste désabusé, est engagé pour faire sortir Ellie, 14 ans, d\'une zone de quarantaine militaire. Mais ce qui devait être une simple mission de routine se transforme vite en un dangereux périple à travers le pays.', '2023-03-28', 43),
(48, 'Dredge', 25.000, 'Prenez le gouvernail de votre chalutier pour partir à la découverte d’une collection d’îles isolées, et des profondeurs avoisinantes, histoire de voir ce qui se cache sous la surface. Vendez votre prise aux gens du cru et accomplissez des quêtes pour en apprendre plus au sujet du passé troublé de chaque zone. Installez un meilleur équipement sur votre bateau pour pêcher en eaux profondes et atteindre des contrées éloignées, mais ne perdez jamais de vue l’heure. Mieux vaut ne pas se retrouver au milieu de l’océan à la nuit tombée...', '2023-03-30', 44),
(54, 'The Legend of Zelda: Tears of the Kingdom Switch -', 65.490, 'Une aventure épique à travers les terres et les cieux d\'Hyrule vous attend dans The Legend of Zelda: Tears of the Kingdom sur Nintendo Switch. Créez votre propre aventure dans un monde où vous pouvez donner libre cours à votre imagination.', '2023-12-05', 45),
(55, 'Golf Gang - Europe', 1.000, 'Golf Gang est un jeu de course de mini-golf en groupe très rapide ! Alliez précision et vitesse pour l\'emporter dans le mode en ligne à 8 joueurs et peaufinez vos compétences en mode solo pour faire le meilleur temps possible.', '2022-05-19', 46),
(56, 'Red Dead Redemption 2', 14.790, 'Red Dead Redemption 2 pour PC est un jeu d\'action et d\'aventure, open world, dans lequel le joueur peut errer librement et jouer à la troisième personne, tout en revenant à la première personne en mode simulation. Le joueur peut commettre des crimes, mais il doit ensuite être prêt à être traqué par les forces de l\'ordre, prêt à faire peser toute la force de la loi contre le malfaiteur !', '2019-12-05', 47),
(57, 'Hell Let Loose', 18.740, 'Hell Let Loose pour PC est un jeu à la première personne multijoueur qui se déroule pendant la Seconde Guerre mondiale. Le jeu est spécialisé dans les batailles à cent joueurs, mais ce n\'est pas vous contre quatre-vingt-dix-neuf autres féroces. Au lieu de cela, vous êtes répartis en unités de six soldats chacune, et les différentes unités (environ huit par camp) sont divisées en deux équipes.', '2021-07-27', 44),
(58, 'Midvinter', 2.160, 'Monkey Island meets Over the Garden Wall, in a dark forest somewhere in Sweden.  In this cozy little point-and-click fairy-tale, you are a gnome on an abandoned farm. When you realize that humans have come to live there once more, you find yourself useful again - but also that you might have to work harder than ever to keep them safe from the dark creatures that lurk out in the forest. You might even have to call on some of the fair folks for help. Their aid, however, does not come without a price...', '2018-05-05', 48);

